import * as React from "react";
import { useForm } from "react-hook-form";
import Headers from "./Header";
import "./styles.css";

let renderCount = 0;

type FormValues = {
  date: number;
  tradeid: string;
  clientid: string;
};

export default function App() {
  const {
    register,
    handleSubmit,
    formState: { errors }
  } = useForm<FormValues>();

  return (
    <form
      onSubmit={handleSubmit((data) => {
        console.log(data);
      })}
    >
      <Headers
        renderCount={renderCount}
        description="Performant, flexible and extensible forms with easy-to-use validation."
      />
      <label htmlFor="date">Query by Date:</label>
      <input
        {...register("date", { valueAsNumber: true })}
        id="date"
      />
      {errors.date && <p>{errors.date.message}</p>}

      <label htmlFor="tradeid">Query by TradeID:</label>
      <input
        {...register("tradeid", {
          required: "This is required",
          maxLength: { value: 4, message: "You exceeded the max length" }
        })}
      />

      <label htmlFor="age">Age</label>
      <input
        type="number"
        {...register("age", { valueAsNumber: true })}
        id="age"
      />

      <label htmlFor="gender"></label>
      <select {...register("gender")} id="gender">
        <option value="">Select...</option>
        <option value="male">male</option>
        <option value="female">female</option>
      </select>

      <label htmlFor="developer">Are you a developer?</label>
      <input {...register("developer")} value="yes" type="checkbox" />

      <input type="submit" />
    </form>
  );
}
